# init
def create_neuron_param_file(modelid):
    neup = I.scp.build_parameters(neuron_params[modelid]).as_dict()
    hocname = I.os.path.basename(neup['neuron']['filename'])
    landmarkname = hocname[:-4]+'.landmarkAscii'
    neup['neuron']['filename'] = I.os.path.join(morphologies_folder,hocname)
    neup['sim']['recordingSites'] = [I.os.path.join(morphologies_folder,landmarkname)]
    return neup

# init
def plot_vt(vt, cmap = I.matplotlib.cm.viridis):
    colors = deepcopy(cmap.colors)
    colors = [[0,0,1]] + colors + [[1,0,0]]
    my_viridis = I.matplotlib.colors.ListedColormap(colors, name='cmr.wildfire', N=len(colors))
    I.plt.imshow(vt, aspect = 'auto', interpolation = 'none', cmap = my_viridis, vmin = -80, vmax = 0)
    ax = I.plt.gca()
    xticks = I.np.arange(0,40*max(vt.columns), 20*50)
    xticklabels = I.np.arange(0,max(vt.columns), 25)
    I.plt.xticks(xticks, xticklabels, rotation = 45)
    I.plt.colorbar()
    I.plt.xlabel('t post simulation onset / ms')
    I.plt.ylabel('trial')
    
# init 
def histogram2(hist_bins, color = None, ax = None, label = None, mode = 'step'):
    
    '''hist_bins: tuple of the format (bins,hist) where bins needs to be one element longer than hist
        bins: bin edges; hist: bin values
    '''
    if ax is None:
        ax = I.plt.gca()
    bins, hist = hist_bins

    # add points, so we always start  at 0
    x = [bins[0]]
    y = [0]
    # create line that goes in rectangular steps
    for lv in range(len(hist)):
        x += [bins[lv], bins[lv+1]]
        y += [hist[lv], hist[lv]]
    # add points so we always end at 0
    x += [bins[-1]]
    y += [0]
        
    if mode == 'step':
        ax.step(x,y, color = color, label = label)
    elif mode == 'filled':
        I.plt.fill_between(x,y,[0]*len(x),color=color,label=label,linewidth = 0) 
        
# init
def scale_PSTH(PSTH, ongoing = 1.0, onset = 1.0, sustained = 1.0, onset_end = 60, celltype = 'INT'):
    ongoing = float(ongoing)
    onset = float(onset)
    sustained = float(sustained)
    out = {}
    PSTH_out = deepcopy(PSTH)
    bins, values = PSTH[celltype]
    values = list(values)
    for lv in range(len(values)):
        if lv == 0:
            values[0] = values[0] * ongoing
            if verbose: print('applying ongoing scaling to bin', bins[lv], bins[lv+1])
        elif bins[lv+1] <= onset_end:
            values[lv] = values[lv]*onset
            if verbose: print('applying onset scaling to bin', bins[lv], bins[lv+1])            
        elif bins[lv+1] <= 700:
            values[lv] = values[lv]*sustained  
            if verbose: print('applying sustained scaling to bin', bins[lv], bins[lv+1])                        
        else:
            values[lv] = values[lv]*ongoing
            if verbose: print('applying onset scaling to bin', bins[lv], bins[lv+1])     
    PSTH_out[celltype] = (bins, values)
    return PSTH_out

def timshift_PSTH(PSTH, shift = 0., celltype = 'INT'):
    out = {}
    PSTH_out = deepcopy(PSTH)
    bins, values = PSTH[celltype]
    PSTH_out[celltype] = (list(I.np.array(bins) + shift), values)
    return PSTH_out

#init 
@I.cache
def _helper_get_conectivity_path(morphology, connectivity):
    return anatomical_model_mdb[morphology][connectivity]

@I.dask.delayed
def _helper_create_param_files(simulation_outdir, output_name,syn,con,currentPSTH,syn_strengths,evoked_columns, offset, model):
    netp = create_network_param_file(syn,con,currentPSTH,syn_strengths,evoked_columns, offset = offset)
    neup = create_neuron_param_file(model)
    if not I.os.path.exists(simulation_outdir.join(output_name)):
        I.os.makedirs(simulation_outdir.join(output_name))
    else:
        #pass
        raise RuntimeError()
    netp_path = simulation_outdir.join(output_name).join('netp.param')
    neup_path = simulation_outdir.join(output_name).join('neup.param')
    I.scp.NTParameterSet(netp).save(netp_path)    
    I.scp.NTParameterSet(neup).save(neup_path)    

    
def get_delayeds_from_params(params, nSweeps = 1, nprocs = 48):
    morphology = params['morphology']
    connectivity = params['connectivity']
    # run simulation
    d = _helper_get_conectivity_path(morphology, connectivity)
    syn = d.get_file('.syn')
    con = d.get_file('.con')

    verbose = False
    
    scale_ongoing = float(params['scale_ongoing'])
    scale_onset = float(params['scale_onset'])
    scale_sustained = float(params['scale_sustained'])
    INH_timeshift = float(params['INH_timeshift'])
    if 'onset_end' in params:
        onset_end = params['onset_end']
    else:
        onset_end = 60

    if params['PSTH'] == 'PSTHs_1ms':
        PSTH = PSTHs_1ms
    elif params['PSTH'] == 'PSTHs_1ms_cut_at_200':
        PSTH = {k:(v[0][:30],v[1][:29]) for k,v in PSTHs_1ms.items()}
    else:
        raise ValueError()
        
    currentPSTH = scale_PSTH(PSTH, scale_ongoing, scale_onset, scale_sustained, onset_end)
    currentPSTH = timshift_PSTH(currentPSTH, INH_timeshift)

    offset = params['offset']
    evoked_columns = params['evoked_columns']
    syn_strengths = params['syn_strengths']
    output_name = params['output_name']
    model = params['model']
    simulation_outdir = params['simulation_outdir']
    ds_prepare_params = _helper_create_param_files(simulation_outdir, output_name,
                                                    syn,con,currentPSTH,syn_strengths,evoked_columns, offset, model)

    netp_path = simulation_outdir.join(output_name).join('netp.param')
    neup_path = simulation_outdir.join(output_name).join('neup.param')
    ds = I.simrun_run_new_simulations(neup_path,
                                      netp_path,
                                      dirPrefix = simulation_outdir.join(output_name), 
                                      nSweeps = nSweeps, 
                                      nprocs = nprocs, #sum(client.ncores().values()),#48*3, 
                                      tStop = params['tStop'],
                                      silent = True,
                                      child_process=False,
                                      tar = False)
    
    return ds_prepare_params, ds

